import * as React from 'react';
import {useEffect} from "react";
import { View, Text, StyleSheet} from 'react-native';

function ConnectedScreen( {navigation} ) {
    useEffect(() => {
      setTimeout(() => navigation.navigate('Main Function'), 1500);
    });
    
    return (
      <View style={styles.container}>
          <Text style = {styles.Connected}>YAY! You are connected</Text>
      </View>
      
    );
  }

  const styles = StyleSheet.create({
    container: {
      flex : 1,
      alignItems: 'center',
      justifyContent: 'center',
      backgroundColor: '#fff',
    },
    
    Connected: {
      textAlign: 'center',
      backgroundColor : '#00FF00',
      marginLeft: 25,
      marginRight: 25,
      marginTop: 50,
      marginBottom: 50,
      height: 40,
      width : 300,
      color: "#000", 
      fontWeight: "bold", 
      fontSize: 20,
      borderColor: 'gray', 
      borderWidth: 5,
    },
  });

export default ConnectedScreen;
